use whisky::{
    utils::blueprint::{MintingBlueprint, SpendingBlueprint},
    BuilderDataType, LanguageVersion,
};

use crate::{config::AppConfig, scripts::blueprints::vault_oracle::vault_oracle_mint_blueprint};

pub fn withdrawal_intent_mint_blueprint() -> MintingBlueprint {
    let oracle_nft = vault_oracle_mint_blueprint().hash;

    let mut blueprint = MintingBlueprint::new(LanguageVersion::V3);
    blueprint
    .param_script(
        "",
        &[oracle_nft.as_str(), "todo: lp_decimal"],
        BuilderDataType::JSON,
    )
    .unwrap();
    blueprint
}

pub fn withdrawal_intent_spend_blueprint() -> SpendingBlueprint {
    let AppConfig { network_id, .. } = AppConfig::new();
    let oracle_nft = vault_oracle_mint_blueprint().hash;

    let mut blueprint =
        SpendingBlueprint::new(LanguageVersion::V3, network_id.parse().unwrap(), None);
    blueprint
    .param_script(
        "",
        &[oracle_nft.as_str()],
        BuilderDataType::JSON,
    )
    .unwrap();
    blueprint
}

